import React from "react";
import "./About.scss";
import "../Button/Button.scss";

export default function About() {
	return (
		<section className="about" id="about">
			<div className="container">
				<h2 className="about__title">&#128075; - About myself</h2>
				<p className="about__para"></p>
				<p className="about__para">
					A dependable, adaptable and meticulous individual, with a
					keen eye for analysing details to achieve the desired
					results.
				</p>
				<p className="about__para">
					In my spare time when I'm not coding, you'll probably find
					me playing Apex Legends, or working on my latest side
					project.
				</p>

				<a className="button--primary about__button" href="/about">
					more about me
				</a>
			</div>
		</section>
	);
}
